    let {rows, cols, boxs, qubs}= Vertex(parseInt(sizing))

    updateEvery(sizing*sizing, rows, cols, boxs)

    // console.log(rows, cols, boxs, qubs)
    return (
        <div>{ rows.length &&
            <Two rows={rows} sizing={sizing}/>
            }
        </div>
    )
}
